import Autocomplete from "react-google-autocomplete";
import React from "react";


const autocomplete = () => {

  const myKey = process.env.REACT_APP_MAP_API_KEY;

  return (
  <Autocomplete  
    apiKey={myKey}
    onPlaceSelected={(place) => {
      console.log(place);
    }}
    />
  )};

  export default autocomplete;
